import {Avatar, Grid, Button, Container, Paper, Typography} from "@mui/material";
const Auth = () => {
    const state = null;
    return(
        <Container component="main" maxWidth={"xs"}>
            <Paper sx={{
                marginTop: '10px',
                display: 'flex',
                flexDirection: 'column',
                alignItems: 'center',
                padding: '15px',
            }} elevation={3}>

            </Paper>
        </Container>
    )
}
export default Auth;
